// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

contract ConsentResource is Initializable, UUPSUpgradeable, OwnableUpgradeable {

    struct Resource {
        bytes32 resourceURI;
        bytes32 resourceType;
        uint256 uploadDate;
        uint256 position;
        bool show;
        address owner;
        uint index;
    }

    mapping (bytes32 => mapping(bytes32 => Resource)) resources;
    mapping (bytes32 => bytes32[]) resourcesName;

    function initialize() initializer public {
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    function _authorizeUpgrade(address) internal override onlyOwner {}

    function getConsentResources (bytes32 consentId) external view 
        returns (bytes32[] memory, bytes32[] memory, uint256[] memory, bool[] memory) {
        bytes32[] memory resourceURI_ = new bytes32[](resourcesName[consentId].length);
        bytes32[] memory resourceType_ = new bytes32[](resourcesName[consentId].length);
        uint256[] memory position_ = new uint256[](resourcesName[consentId].length);
        bool[] memory show_ = new bool[](resourcesName[consentId].length);

        for (uint i = 0; i < resourcesName[consentId].length; i ++) {
            resourceURI_[i] = resources[consentId][resourcesName[consentId][i]].resourceURI;
            resourceType_[i] = resources[consentId][resourcesName[consentId][i]].resourceType;
            position_[i] = resources[consentId][resourcesName[consentId][i]].position;
            show_[i] = resources[consentId][resourcesName[consentId][i]].show;
        }

        return (resourceURI_, resourceType_, position_, show_);
    }

    function addResource (bytes32 consentId, bytes32 name, bytes32 resourceURI, bytes32 resourceType, 
        uint256 position, bool show) external {
        require(resources[consentId][name].uploadDate == 0, "Resource already exists");

        resourcesName[consentId].push(name);
        resources[consentId][name].resourceURI = resourceURI;
        resources[consentId][name].resourceType = resourceType;
        resources[consentId][name].uploadDate = block.timestamp;
        resources[consentId][name].position = position;
        resources[consentId][name].show = show;
        resources[consentId][name].owner = msg.sender;
        resources[consentId][name].index = resourcesName[consentId].length - 1;
    }

    function updateResourceVisibility (bytes32 consentId, bytes32 name, bool visibility) external {
        require(resources[consentId][name].uploadDate > 0, "Resource doesn't exist");

        require(resources[consentId][name].owner == msg.sender, "You are not the owner");

        resources[consentId][name].show = visibility;
    }
}
